import React from 'react';
import './Video.scss';
import vidImage from '../../assets/images/video-list-0.jpg';
import vidPlay from '../../assets/icons/Icon-play.svg';
import vidScrub from '../../assets/icons/Icon-scrubber-control.svg';

export default function Video () {
    return (
    <section className="video">
        <video className="video-player" poster={vidImage}>
        </video>
        <img className="video-play-icon" src={vidPlay} alt="play icon"/>
        <img className="video-scrub-icon" src={vidScrub} alt="scrubber icon"/>
    </section>
    );
}
